demo.repl.help:
Comenzi disponibile:
  @show              ─ afișează ultimul rezumat al cardului adaptiv
  @json              ─ emite valoarea JSON brută primită din flux
  @back              ─ revine la cardul/intrările blocate anterioare
  @input <k>=<v>     ─ setează sau suprascrie un câmp de intrare
  @click <action_id> ─ trimite cardul cu acțiunea furnizată
  @help              ─ afișează acest text de ajutor
  @quit              ─ ieșire din REPL
